# How wide each time bin is (in the same units as your timings)
BIN_SIZE = 100    
# How many time bins to look at in one window
WINDOW_SIZE = 10  

# --- These are set automatically ---
NUM_FEATURES = len(all_data_lists)
INPUT_SHAPE = (WINDOW_SIZE, NUM_FEATURES) # e.g., (10, 2)


# ==============================================================================
# --- 3. DATA PREPARATION FUNCTIONS ---
# ==============================================================================

def convert_to_binned_data(all_timings_lists, bin_size):
    """
    Converts a list of asynchronous "time-between-toggles" lists
    into a single, synchronous 2D array of "toggles-per-bin".
    """
    
    # --- Step 1: Reconstruct the absolute timeline for each signal ---
    all_toggle_times = []
    for timings in all_timings_lists:
        all_toggle_times.append(np.cumsum(timings))
    
    # --- Step 2: Find the total duration ---
    total_duration = 0
    for times in all_toggle_times:
        if len(times) > 0:
            total_duration = max(total_duration, times[-1])
    
    # --- Step 3: Create the time bins ---
    bins = np.arange(0, total_duration + bin_size, bin_size)
    
    # --- Step 4: Count toggles in each bin for ALL signals ---
    all_counts = []
    for times in all_toggle_times:
        counts, _ = np.histogram(times, bins=bins)
        all_counts.append(counts)
    
    # --- Step 5: Combine the counts into one 2D array ---
    binned_data = np.stack(all_counts, axis=1)
    
    return binned_data

def create_sliding_windows(data, window_size):
    """
    Converts a 2D array (samples, features) into a 3D array
    (samples, window_size, features).
    """
    all_windows = []
    num_samples = len(data) - window_size + 1
    for i in range(num_samples):
        window = data[i : i + window_size]
        all_windows.append(window)
    return np.array(all_windows)


# ==============================================================================
# --- 4. AUTOENCODER MODEL & TRAINING FUNCTIONS ---
# ==============================================================================

def build_simple_autoencoder():
    """
    Builds an autoencoder using Flatten and Dense layers.
    It automatically uses the global INPUT_SHAPE.
    """
    model = keras.Sequential()
    
    # --- Encoder ---
    model.add(layers.Input(shape=INPUT_SHAPE))
    model.add(layers.Flatten())
    model.add(layers.Dense(32, activation='relu'))
    model.add(layers.Dense(16, activation='relu')) # Bottleneck
    
    # --- Decoder ---
    model.add(layers.Dense(32, activation='relu'))
    model.add(layers.Dense(WINDOW_SIZE * NUM_FEATURES, activation='sigmoid'))
    model.add(layers.Reshape(INPUT_SHAPE))
    
    model.compile(optimizer='adam', loss='mse')
    return model

def train_model(autoencoder, all_timings_lists, bin_size, window_size):
    """
    Trains the autoencoder and returns the model, scaler, and threshold.
    """
    print("Starting model training...")
    
    # 1. PREPARE YOUR DATA
    print("Step 1: Converting to binned data...")
    binned_data = convert_to_binned_data(all_timings_lists, bin_size)
    print(f"Binned data shape: {binned_data.shape}")

    # 2. SCALE THE DATA
    print("\nStep 2: Scaling data...")
    scaler = MinMaxScaler()
    scaled_data = scaler.fit_transform(binned_data)

    # 3. CREATE SLIDING WINDOWS
    print("\nStep 3: Creating sliding windows...")
    X_train = create_sliding_windows(scaled_data, window_size)
    print(f"Final X_train shape for model: {X_train.shape}")
        
    # 4. Train the model
    autoencoder.fit(
        X_train,
        X_train,
        epochs=50, # Increased epochs for better training
        batch_size=32,
        shuffle=True,
        validation_split=0.1,
        verbose=1
    )
    
    # 5. Calculate the anomaly threshold
    reconstructions = autoencoder.predict(X_train)
    errors = np.mean(np.square(X_train - reconstructions), axis=(1, 2))
    threshold = np.quantile(errors, 0.99)
    
    print(f"Training complete. Anomaly threshold set to: {threshold}")
    return autoencoder, scaler, threshold


# ==============================================================================
# --- 5. DETECTION FUNCTION ---
# ==============================================================================

def detect_anomalies(new_all_timings_lists, model, scaler, bin_size, window_size, threshold):
    """
    Runs the full detection pipeline on new raw data.
    """
    print("\n--- Testing new data... ---")
    
    # 1. Binning: Convert raw timings to binned counts
    try:
        binned_test_data = convert_to_binned_data(new_all_timings_lists, bin_size)
        if binned_test_data.shape[0] < window_size:
            print("Error: New data is shorter than the window size.")
            return [], []
    except Exception as e:
        print(f"Error binning new data: {e}")
        return [], []

    # 2. Scaling: Use the *same* scaler (scaler.transform)
    scaled_test_data = scaler.transform(binned_test_data)
    
    # 3. Windowing: Create sliding windows
    test_windows = create_sliding_windows(scaled_test_data, window_size)
    if test_windows.shape[0] == 0:
         print("No windows created from new data.")
         return [], []

    # 4. Prediction: Get reconstructions
    reconstructions = model.predict(test_windows)
    
    # 5. Error: Calculate MSE for each window
    errors = np.mean(np.square(test_windows - reconstructions), axis=(1, 2))
    
    # 6. Decision: Find windows where error > threshold
    anomaly_indices = np.where(errors > threshold)[0]
    
    return errors, anomaly_indices

def export(autoencoder, all_timings_lists, bin_size, window_size):
    """
    Trains the autoencoder and returns the model, scaler, and threshold.
    """
    print("Starting model training...")
    
    # 1. PREPARE YOUR DATA
    print("Step 1: Converting to binned data...")
    binned_data = convert_to_binned_data(all_timings_lists, bin_size)
    print(f"Binned data shape: {binned_data.shape}")

    # 2. SCALE THE DATA
    print("\nStep 2: Scaling data...")
    scaler = MinMaxScaler()
    scaled_data = scaler.fit_transform(binned_data)

    # 3. CREATE SLIDING WINDOWS
    print("\nStep 3: Creating sliding windows...")
    X_train = create_sliding_windows(scaled_data, window_size)
    print(f"Final X_train shape for model: {X_train.shape}")
        
    # 4. Train the model
    autoencoder.fit(
        X_train,
        X_train,
        epochs=50, # Increased epochs for better training
        batch_size=32,
        shuffle=True,
        validation_split=0.1,
        verbose=1
    )
    
    # 5. Calculate the anomaly threshold
    reconstructions = autoencoder.predict(X_train)
    errors = np.mean(np.square(X_train - reconstructions), axis=(1, 2))
    threshold = np.quantile(errors, 0.99)
    
    print(f"Training complete. Anomaly threshold set to: {threshold}")
    
    scaler_min = scaler.min_
    scaler_scale = scaler.scale_

    print("\n--- PARAMETERS TO COPY INTO C CODE ---")
    print("#define ANOMALY_THRESHOLD %ff" % threshold)
    # We need to format these as C arrays
    min_str = ", ".join([f"{f}f" for f in scaler_min])
    scale_str = ", ".join([f"{f}f" for f in scaler_scale])
    print(f"const float scaler_min[] = {{ {min_str} }};")
    print(f"const float scaler_scale[] = {{ {scale_str} }};")
    print("----------------------------------------\n")

    # --- 3. CONVERT MODEL TO TFLITE (INT8 QUANTIZED) ---

    # We need a "representative dataset" for quantization.
    # We'll use our X_train data.
    def representative_data_gen():
        for i in range(100): # Use 100 samples
            yield [X_train[i:i+1].astype(np.float32)]

    converter = tf.lite.TFLiteConverter.from_keras_model(autoencoder)
    converter.optimizations = [tf.lite.Optimize.DEFAULT]
    converter.representative_dataset = representative_data_gen
    # Enforce integer-only quantization
    converter.target_spec.supported_ops = [tf.lite.OpsSet.TFLITE_BUILTINS_INT8]
    converter.inference_input_type = tf.int8  # Input is int8
    converter.inference_output_type = tf.int8 # Output is int8

    tflite_model_quant = converter.convert()

    # Save the model
    with open('anomaly_model.tflite', 'wb') as f:
        f.write(tflite_model_quant)
    

